function decrypt(data, cfg) {
	crypt(data, cfg.pattern, cfg.plugin.decode, cfg.key(), cfg.ivKey(), cfg.saltKey())   
}
function encrypt(data, cfg) {
	crypt(data, cfg.pattern, cfg.plugin.encode, cfg.key(), cfg.ivKey(), cfg.saltKey());
    console.log(data);
    return data;
}
function startsWith(str, prefix) {
  if (str.length < prefix.length)
    return false;
  for (var i = prefix.length - 1; (i >= 0) && (str[i] === prefix[i]); --i)
    continue;
  return i < 0;
}
function crypt(events, pattern, callback, base64Key, iv, salt) {
    
    var keys = Object.keys(events);
    for (var i in keys) {

        // if (keys[i].endsWith(pattern))
        // if (keys[i].startsWith(pattern))
        if (startsWith(keys[i], pattern))
            events[keys[i]] = callback(events[keys[i]], base64Key, iv, salt);
        if (events[keys[i]] && typeof events[keys[i]] === 'object')
            crypt(events[keys[i]], pattern, callback, base64Key, iv, salt)
    }
}

function checkHeader(cfg, contentType) {
    if(!contentType) { return false; }
    return(cfg.contentHeaderCheck.check(contentType));
}

String.prototype.beginsWith = function (string) {
    return(this.indexOf(string) === 0);
};

String.prototype.endsWith = function (str) {
    var lastIndex = this.lastIndexOf(str);
    return (lastIndex != -1) && (lastIndex + str.length == this.length);
};

function defaultVal(val, defaultVal){
    if(typeof val==='undefined'){
        return defaultVal;
    }else{
        return val;
    }
};
